import React, { Component } from "react";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";
import axios from 'axios';

export default class Register extends Component {
  constructor(props) {
    super(props);
    this.state = { username: "", password: "" , email:"", name:"", contact:"" , datas: [] ,};
  }

  handlechange= (event) => {
    const target = event.target;
    const name= target.name;
    const value= target.value;

    this.setState({
        [name] : value
    });
};


submit = async(event) => {
    event.preventDefault();

    const payload= {
        username : this.state.username,
        password : this.state.password,
        email : this.state.email,
        name : this.state.name,
        contact : this.state.contact
    };

    await axios ({
        url:"http://commerchant.herokuapp.com/users/register",
        method: "POST", 
        data: payload
    })

    .then(contents => alert(contents.data.success))
    .then(data => this.setState({datas: data }), console.log(this.state.datas))
    .catch(() => console.log("Log in Başarısız"));
};

  render() {
    return (
      <div>
        <h3>{this.props.currentCategory}</h3>
        <Form onSubmit={this.submit}>
          <FormGroup>
            <FormGroup>
              <Label for="name">Name</Label>
              <Input
                type="text"
                name="name"
                value={this.state.name}
                placeholder="Enter Your Name!"
                onChange={this.handlechange}
              />
            </FormGroup>

            <Label for="username">Username</Label>
            <Input
              type="text"
              name="username"
              value={this.state.username}
              placeholder="Enter Your Username!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="email">Email</Label>
            <Input
              type="email"
              name="email"
              value={this.state.email}
              placeholder="Enter your e-mail!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="examplePassword">Password</Label>
            <Input
              type="password"
              value={this.state.password}
              name="password"
              placeholder="Enter Your Password!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <FormGroup>
            <Label for="contact">Contact</Label>
            <Input
              type="text"
              name="contact"
              value={this.state.contact}
              placeholder="Enter Your Phone Number!"
              onChange={this.handlechange}
            />
          </FormGroup>

          <Button>Submit</Button>
        </Form>
      </div>
    );
  }
}
